    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from the U.S. Census Bureau's Master Address File /n               Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
    MTDB represents a seamless national file with no overlaps or gaps between parts,
    however, eachn               TIGER/Line shapefile is designed to stand alone as
    an independent data set, or they can be combined to cover the entire nation. The
    Rails Shapefile includes all features within the MTDB Super Classn               "Rail
    Features" distinguished where the MAF/TIGER Feature Classification Code (MTFCC)
    for the feature in MTDB tha begin with "R". This includes main lines such as spur
    lines, rail yards, mass transitn               rail lines such as carlines, streetcar
    track, monorail or other mass transit rail and special purpose rail lines such as
    cog rail lines, incline rail lines and trams.",nt"license_title": null,nt"extras":
